import React from 'react'

export default function Mainpage() {
    return (
        <div>



            <a className="position-absolute top-0 end-0" href="#">Default</a>


            <div className='mainpage-div'>
                <button type="button" class="btn btn-primary ms-3">Mark Attendence</button>
                <button type="button" class="btn btn-secondary ms-3">Mark Leave</button>
                <button type="button" class="btn btn-info ms-3" >View Attendence</button>
            </div>
        </div>
    )
}
